    "2014-04-15T17:02:00.886891",nt"name": "watershed-boundary-dataset",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is a complete digital hydrologic
    unit boundary layer to the Watershed (10-digit) 5th level for the entire state of
    North Dakota. This data set consists of geo-referenced digital data and associated
    attributes created in accordance with the "Federal Guidelines, Requirements, and
    Procedures for the National Watershed Boundary Dataset; Chapter 3 of Section A,
    Federal Standards, Book 11, Collection and Delineation of Spatial Data; Techniques
    and Methods 11-A3 - Third Edition" (2012). http://pubs.usgs.gov/tm/tm11a3/. Polygons
    are attributed with hydrologic unit codes for 5th level subwatersheds, name, size,
    Updates made to correct HU_10 and HU_12 names to be consistent with National Standards;
